DROP TABLE IF EXISTS Position

/* Create Tables */
CREATE TABLE Position (
	PositionID int identity primary key,
	PositionName varchar(2) not null unique
)

CREATE TABLE Team (
	TeamID int identity primary key,
	TeamAbbreviation varchar(3) not null unique,
	City varchar(20) not null,
	TeamName varchar(20)  not null unique
)

CREATE TABLE Season (
	SeasonID int identity primary key,
	Year int not null unique
)
