CREATE TABLE Player (
	PlayerID int identity primary key,
	FirstName varchar(20) not null,
	LastName varchar(20) not null,
	TeamID int not null foreign key references Team(TeamID),
	SeasonID int not null foreign key references Season(SeasonID),
	PositionID int not null foreign key references Position(PositionID),
	PassCompletion int,
	PassAttempt int,
	PassYard int,
	PassTD int,
	Interception int,
	RushingAttempt int,
	RushYard int,
	RushTD int,
	Target int,
	Reception int,
	RecievingYard int,
	ReceivingTD int,
	FumbleLost int,
	TwoPointScore int,
	FantasyPoints decimal(5,2),
	VBD int
)

