-- SELECT  Statements

-- SELECT Top 10 Passing QBs  
SELECT TOP 10 *
FROM Player
ORDER BY Player.PassYard DESC


-- Double digit Receiving TDs in 2020
SELECT FirstName, LastName, Season.Year, ReceivingTD, Position.PositionName
FROM Player
JOIN Season ON Season.SeasonID = Player.SeasonID
JOIN Position ON Position.PositionID = Player.PositionID
WHERE ReceivingTD >= 10 AND Season.Year = '2020'
ORDER BY ReceivingTD DESC, LastName

-- Total QBs for the Ravens in 2019
SELECT
	COUNT(Player.PlayerID) AS TotalRavenQBs
FROM Player
JOIN Team ON Team.TeamID = Player.TeamID
JOIN Position ON Position.PositionID = Player.PositionID
JOIN Season ON Season.SeasonID = Player.SeasonID
WHERE Team.TeamName = 'Ravens' AND  Season.Year = '2019' AND Position.PositionName = 'QB'

-- Rushing TDs by Team in 2021
SELECT Team.TeamName, 
	SUM(Player.RushTD) AS RushTD_Total
FROM Team
JOIN Player ON Player.TeamID = Team.TeamID
JOIN Season ON Season.SeasonID = Player.SeasonID
WHERE Season.Year = '2021'
GROUP BY 
	Team.TeamName
ORDER BY RushTD_Total DESC


